-- Zrzut struktury procedura id13767441_dziennik.lekcje_klasy
DELIMITER //
CREATE PROCEDURE `lekcje_klasy`(
	IN `klasa_id` INT

)
SELECT * 
FROM lekcja_full_info AS l
WHERE l.klasa_id = klasa_id
ORDER BY l.`data`, l.godz_start ASC//
DELIMITER ;

-- Zrzut struktury procedura id13767441_dziennik.lekcje_nauczyciela
DELIMITER //
CREATE PROCEDURE `lekcje_nauczyciela`(
	IN `nauczyciel_id` INT







)
select l.`data`, l.godz_start, l.godz_koniec, l.oddzial,l.sala,l.przedmiot
from nauczyciel_full_info as n
join lekcja_full_info as l on n.ID = l.nauczyciel_id and `l`.`przedmiot` = `n`.`przedmiot`
where n.ID = nauczyciel_id//
DELIMITER ;

-- Zrzut struktury procedura id13767441_dziennik.lista_osob_w_klasie
DELIMITER //
CREATE PROCEDURE `lista_osob_w_klasie`(
	IN `klasa_id` INT
)
SELECT uz.imie AS 'imie', uz.nazwisko AS 'nazwisko', k.oddzial
FROM uczen as u
INNER JOIN klasa as k ON u.klasa_id = k.klasa_ID 
left JOIN uzytkownik as uz ON u.uzytkownik_login = uz.uzytkownik_login
where k.klasa_ID = klasa_id
ORDER BY nazwisko,imie ASC//
DELIMITER ;

